import React from 'react'
import { useSelector } from 'react-redux'
import TattooCard from '../../TattooCard/TattooCard'

const UserImages = () => {
    const userImagesArray = useSelector((state: any) => state.images.userImages)
    
    const userImagesByUserName = userImagesArray.filter((image: any) => image.userName === localStorage.getItem("userName"))
    return (
        <div>
            {userImagesByUserName && userImagesByUserName.map((image:any)=> <TattooCard {...image}/>)}
            
            
        </div>
    )
}

export default UserImages
